    source: `<script lang="ts">import logo from './assets/images/logo-universal.png';\r\n` +
      "import { Greet } from '../wailsjs/go/main/App.js';\r\n" +
      'let resultText = "Please enter your name below ðŸ‘‡";\r\n' +
      'let name;\r\n' +
      'function greet() {\r\n' +
      '    Greet(name).then(result => resultText = result);\r\n' +
      '}\r\n' +
      '</script>\n' +
      '\n' +
      '<main>\n' +
      '  <img alt="Wails logo" id="logo" src="{logo}">\n' +
      '  <div class="result" id="result">{resultText}</div>\n' +
      '  <div class="input-box" id="input">\n' +
      '    <input autocomplete="off" bind:value={name} class="input" id="name" type="text"/>\n' +
      '    <button class="btn" on:click={greet}>Greet</button>\n' +
      '  </div>\n' +
      '</main>\n' +
      '\n' +
      '<style>\n' +
      '\n' +
      '  #logo {\n' +
      '    display: block;\n' +
      '    width: 50%;\n' +
      '    height: 50%;\n' +
      '    margin: auto;\n' +
      '    padding: 10% 0 0;\n' +
      '    background-position: center;\n' +
      '    background-repeat: no-repeat;\n' +
      '    background-size: 100% 100%;\n' +
      '    background-origin: content-box;\n' +
      '  }\n' +
      '\n' +
      '  .result {\n' +
      '    height: 20px;\n' +
      '    line-height: 20px;\n' +
      '    margin: 1.5rem auto;\n' +
      '  }\n' +
      '\n' +
      '  .input-box .btn {\n' +
      '    width: 60px;\n' +
      '    height: 30px;\n' +
      '    line-height: 30px;\n' +
      '    border-radius: 3px;\n' +
      '    border: none;\n' +
      '    margin: 0 0 0 20px;\n' +
      '    padding: 0 8px;\n' +
      '    cursor: pointer;\n' +
      '  }\n' +
      '\n' +
      '  .input-box .btn:hover {\n' +
      '    background-image: linear-gradient(to top, #cfd9df 0%, #e2ebf0 100%);\n' +
      '    color: #333333;\n' +
      '  }\n' +
      '\n' +
      '  .input-box .input {\n' +
      '    border: none;\n' +
      '    border-radius: 3px;\n' +
      '    outline: none;\n' +
      '    height: 30px;\n' +
      '    line-height: 30px;\n' +
      '    padding: 0 10px;\n' +
      '    background-color: rgba(240, 240, 240, 1);\n' +
      '    -webkit-font-smoothing: antialiased;\n' +
      '  }\n' +
      '\n' +
      '  .input-box .input:hover {\n' +
      '    border: none;\n' +
      '    background-color: rgba(255, 255, 255, 1);\n' +
      '  }\n' +
      '\n' +
      '  .input-box .input:focus {\n' +
      '    border: none;\n' +
      '    background-color: rgba(255, 255, 255, 1);\n' +
      '  }\n' +
      '\n' +
      '</style>\n',
